import React from 'react';
import FormLogin from '../organisme/FormLogin';

function Auth({ children }) {
    return (
        <div className=" h-screen w-screen flex bg-white">
            <div className="md:w-3/6 lg:w-4/6 bg-blue-200">
            </div>
            <div className="md:w-3/6 lg:w-2/6 flex justify-center items-center" >
                <div className="w-full p-8 h-96">
                    <div>
                        <FormLogin />
                        {children}
                    </div>
                </div>
            </div>
        </div>
    );
}

export default Auth;
